jQuery.fn.dataTableExt.aTypes.unshift(function(sData){var sValidChars="0123456789";var Char;for(var i=0;i<sData.length-3;i++){Char=sData.charAt(i);if(sValidChars.indexOf(Char)==-1){return null}}if(sData.substring(sData.length-2,sData.length)=="KB"||sData.substring(sData.length-2,sData.length)=="MB"||sData.substring(sData.length-2,sData.length)=="GB"){return"file-size"}return null});